function Table({data}) {
    const objectIntoTableData = (object) => {
        console.log("Object.values(object)",Object.values(object))
        return Object.values(object).map((data, index) => {
            return  <td key={index}>{data}</td>;
        });
    }

    return (
        <>
            <table>
                <thead>
                    <tr>
                        <th>First Name</th>
                        <th>Last Name</th>
                    </tr>
                </thead>
                <tbody>
                    { data.map(
                        value => {
                            return <tr key={value.index}>{objectIntoTableData(value)}</tr>;
                        })
                    }
                </tbody>
            </table>
        </>
    )
}
export default Table;
